// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/token/ERC20/IERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/AddressUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";

contract TokenSwap is Initializable, PausableUpgradeable {

    using AddressUpgradeable for address payable;

    address payable private _dabacusOwnerAddress;
    IERC20Upgradeable private _dabacusToken;
    bool private initialized;

    function initialize(IERC20Upgradeable token) public {
        require(!initialized, "Contract instance has already been initialized");
        _dabacusToken = token;
        _dabacusOwnerAddress = payable(msg.sender);
        initialized = true;
    }

    function swapETH() public payable whenNotPaused {

        _dabacusOwnerAddress.sendValue(msg.value);
        _dabacusToken.transferFrom(_dabacusOwnerAddress, msg.sender, msg.value * 30000);
    }

    function swapOtherTokens(address _token, uint _amount) public whenNotPaused {
        IERC20Upgradeable token = IERC20Upgradeable(_token);
        uint256 amount = _amount * 10 ** 18;
        uint256 receiveAmount = amount * 200;

        require(
            token.allowance(msg.sender, address(this)) >= amount,
            "You did not approve enough amount to swap"
        );

        require(
            _dabacusToken.allowance(_dabacusOwnerAddress, address(this)) >= receiveAmount,
            "Do not have enough dAbacus tokens available for swap"
        );

        bool sent = token.transferFrom(msg.sender, _dabacusOwnerAddress, amount);
        require(sent, "Token transfer failed");

        sent = _dabacusToken.transferFrom(_dabacusOwnerAddress, msg.sender, receiveAmount);
        require(sent, "Token transfer failed");
    }
}
